import React from "react";
import ReactDom from "react-dom";
import "./index.css";
import bro from"./Used Images/bro.png";
import OsumareLogo from "./OsumareLogo.png";

function Nav(){
    return(<>
    <div></div>
     <nav class="navbar fixed-top nav-baground">
  <div class="container-fluid">
    <a class="navbar-brand"> <img
    src={OsumareLogo}
    /></a>
      <button class="btn btn-outline-success" type="submit">Contect</button>
  </div>
</nav>



<div className="container-fluid position-relative main-div">
            <div className="position-relative container-fluid  main1 d-grid text-center align-item-center over-dib-b  align-self-center">
                <h1> Elevate <span class="fw-bold">Real Estate Success</span> with</h1>
                <h1> Osumare's Digital Expertise</h1>
                <p className="fs-5">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>
                <button class="btn btn-primary d-grid gap-2 col-3 mx-auto rounded-pill" type="button">Get started</button>

                <div className="position-absolute  end-0 col-4 text-end over-div container-fluid">
                    <img class="back-light" src={Ellipse} />
                </div>
            </div>
            <div class=" text-center mt-5">
            <img class="home-img position-relative" src={bro}/>
            <img class="text-img position-absolute" src={Frame}/>
            </div>
        </div>

   </>);
}
export default Nav;
